import * as React from 'react';
import {useStyletron} from 'baseui';
import {Table} from 'baseui/table';





export default (props) => {

    const date = props.covidData[0] && props.covidData[0].date.length > 0 && `${props.covidData[0].date}`
    const cases = props.covidData[0] && `${props.covidData[0].cases}`
    const deaths = props.covidData[0] && `${props.covidData[0].deaths}`
    const county = props.covidData[0] && `${props.covidData[0].county}`
    const state = props.covidData[0] && `${props.covidData[0].state}`

    const COLUMNS = ['Date', 'Total Cases', 'Total Deaths', 'State', 'County', 'Population'];    

    const DATA = [
        [`${date}`,`${cases}`, `${deaths}`,`${state}`,`${county}`],
    ];
  const [css] = useStyletron();
  return (
    <div className={css({height: '60%', width: '100%'})}>
      <Table columns={COLUMNS} data={DATA} />
    </div>
  );
};


